import React, { useState, useEffect } from 'react';
import axios from 'axios';
import App from './App';

const AxiosTest = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        axios.get('https://localhost:8080/auth')
            .then(response => {
                setUsers(response.data);
            });
    }, []);

    return (
        <>
            <h1>Users</h1>
            <App users={users}/>
        </>
    );
}

export default AxiosTest;
